<template name="roundItem">
	<div class="round">
		<div class="round-content">
			<h5>ROUND HISTORY ITEM</h5>
			<ul>
				<li>userid:{{userid}}</li>
				<li>round number:{{roundNum}}</li>
				<li>failYN: {{failYN}}</li>
				<li>insuredYN: {{insuredYN}}</li>
				<li>payout: {{payout}}</li>
				<li>completedYN: {{completedYN}}</li>
				<li>(optional) payoutDetails: {{payoutDetails}}</li>
			</ul>
		</div>
	</div>
</template>
